pragma solidity ^0.8.0;

interface IRouter {
    function initialize(address,address,string memory) external;

    function curatorDeposit(address[] memory,uint256[] memory,uint256[] memory) external;

    function issue(uint256,string memory,uint256,uint256,uint256,uint256) external;

    function claimFees() external;

    // whiteList
    function mintToScale(uint256,address) external;

    function updateRouter(address) external;

    // get
    function VERSION_NAME() view external returns(string memory);

    function VERSION_NUMBER() view external returns(uint16);

    function veTokenTemplate() view external returns(address); 

    function vaultTemplate() view external returns(address); 

    function auctionTemplate() view external returns(address); 

    function voteTemplate() view external returns(address); 

    function divisionTemplate() view external returns(address); 

    // event
    event Initialize(address curator, address vault); 

    event Cash(address indexed owner, uint256 shares); 

    event CuratorDeposit(address[] nft, uint256[] nftId,uint256[] amount); 

    event Issue(uint256 supply,string name, string symbol,uint256 reserveRatio, uint256 EntireVaultPrice,uint256 depositLength,uint256 rewardLength,address vetoken,address auction,address vote,address division); 
}

//SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

interface IVote {
    // ///notion initialize for First Creation.
    ///param  _veToken the  value for  connect veToken
    function initialize() external;

    ///notion createVote.
    ///param  codeModel_  GovernanceTemplate ID.
    function createVote(
        string memory voteTopic_,
        string memory describe_,
        uint256  codeModel_,
        uint256  valaue_
        ) external returns(uint256);

    ///notion Vote.
    ///param  result_   VoteId
    ///param  voteId_  false or true
    function toVote(uint256 voteId_,bool result_) external;

    ///notion rejecting the proposal.
    ///param  _voteId   VoteId
    ///param  _reasons   The reasons for rejecting the proposal
    function reject(uint256 voteId_,string memory reasons_) external;

    ///notion If the vote passes execute the proposal.
    ///param  voteId_   voteID
    function execute(uint256 voteId_)external;

    ///notion authorize someone else to vote for you
    ///param  to_   authorized person
    function delegateTo(uint256 voteId_,address to_)external;

    ///notion Templates should be set up before voting
    function setGovernanceTemplate(
        string memory topic_,
        address targetAddress_,
        string memory  functionName_) external;

    //notion voting result
    ///param  voteId_   voteID
    function winningProposal(uint256 voteId_) external view returns(
        uint256 forVote,
        uint256 againstVote,
        uint256 forVote2,
        uint256 againstVote2,
        uint256 time);

    event CreateVoteEvent(
        uint256 indexed voteId_,
        string indexed voteTopic_,
        string indexed describe_,
        uint256 codeModel_,
        uint256 valaue_
    );

    event InitializeEvent(address indexed  veToken_);
    event ToVoteEvent(uint256 indexed  voteId_, bool result_);
    event RejectEvent(uint256 indexed  voteId_, string reasons_);
    event ExecuteEvent(uint256 indexed voteId_);
    event DelegateToEvent(uint256 indexed  voteId_, address to_);
    event SetGovernanceTemplateEvent(string topic_, address targetAddress_, string functionName_);
    
}

